import React from 'react';
import { Link } from 'react-router-dom';
import { blogdata } from './BlogData';


function BlogPage(){
    return(
        <>
            <h1>BlogPage</h1>
           <ul>
           {blogdata.map(post => (
                <BlogLink post={post}/>
            ))}
           </ul>
        </>
    )
}

function BlogLink({post}){
    return(
        <li>
          <Link to={`${post.numberArticle}/${post.slug}`}>{post.title}</Link>
        </li>
    );
}



export {BlogPage}
